import "../styles/board.css";

export default function Board() {
  let board = [];
  for (let i = 0; i < 9; i++) {
    let box = [];
    for (let j = 0; j < 9; j++) {
      box.push(0);
    }
    board.push(box);
  }
  console.log(board);
  return (
    <div className="board">
      {board.map((box, index) => (index % 3 == 0 ? <div></div> : <div></div>))}
      {Array(5).map((element) => {
        return <div className="grid-item" id={element}></div>;
      })}
    </div>
  );
}
